import React from 'react';

import '../App.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';
import {NavDropdown, NavItem} from 'react-bootstrap';



const Header = () =>{
    return (
       
    <Navbar className="navbar navbar-expand-lg navbar-dark color3">
        <Navbar.Brand href="#home">
            <img src="https://media.discordapp.net/attachments/315005339613265923/689333380378001508/logito.png?width=475&height=475" width="125" height="125" alt=""/>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
            <Form inline className="">
                <FormControl type="text" size="md" placeholder="Search" className="input-group mb-3 form-inline my-3 mm md2"/>
                <Button variant="outline-success">Search</Button>
            </Form>
            <NavItem inline><Button variant="warning" className="justify-content-end"> Registrate</Button>{' '}</NavItem> 
            <Nav.Link href="#link">  <Button variant="outline-danger">Danger</Button>{' '}</Nav.Link>
        </Nav>
     
        </Navbar.Collapse>
    </Navbar>
    );
}
export default Header;
